  `id` int(11) NOT NULL AUTO_INCREMENT,
  `channelID` int(11) DEFAULT NULL,
  `channelProductID` varchar(255) DEFAULT NULL,
  `gameProductID` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

